import React from "react";

const SearchPopup = () => {
  return (
    <form>
      <h3>Search</h3>
      <label>Destination</label>
      <input type="text" />
      <label>Check-in Date</label>
      <input type="date" />
    </form>
  );
};

export default SearchPopup;
